$(function(){emojify.setConfig({img_dir:"//rawgithub.com/Ranks/emojify.js/master/dist/images/basic/",ignore_emoticons:!0}),emojify.run(),$('[class*="font-"]').each(function(){var s=$(this).attr("class").replace(/font-(\d+)/,"$1");$(this).css("font-size",s+"%")}),$('[class*="width-"]').each(function(){var s=$(this).attr("class").replace(/width-(\d+)/,"$1");$(this).find("> *").css("width",s+"%")})});